import { Link } from 'react-router-dom';
import logo from '../img/logo.svg';

function Footer() {
  return (
    <footer className="footer">
      <div className="footer__body-address">
        <Link to='/' className="footer__logo-link">
          <img src={logo} alt="логотип" className="footer__logo logo" />
        </Link>
        <address className="footer__address">
          <span className="footer__address-desc">ИП Шушкевич Андрей Викторович УНП 192602485 Минским горисполкомом 10.02.2016</span>
          <span className="footer__address-desc">ИП Шушкевич Андрей Викторович УНП 192602485 Минским горисполкомом 10.02.2016</span>
          <span className="footer__address-desc">ИП Шушкевич Андрей Викторович УНП 192602485 Минским горисполкомом 10.02.2016</span>
          <span className="footer__address-desc">ИП Шушкевич Андрей Викторович УНП 192602485 Минским горисполкомом 10.02.2016</span>
        </address>

      </div>

    </footer>
  );
}

export default Footer;
